const messages = {
    
    USERNAME_REQUIRED: '* Username required',
    NETWORK_ERROR: 'There was a problem reaching your network, please try again',
    LOGIN_REQUIRED: 'Please login to Chat ',
    DEFAULT: 'Oh no!  Something went wrong, please try again later',
    LOGIN_UNAUTHORIZED: 'Unauthorized user. Please enter valid username!',
    MESSAGE_REQUIRED: '*Message is required',
  };
  
  export default messages;
